import React from 'react';

const OfferListComponent = () => {
  const offers = [
    { id: 1, title: 'Offer 1' },
    { id: 2, title: 'Offer 2' },
    { id: 3, title: 'Offer 3' },
  ];

  return (
    <div className="list-offer">
      <h2>Offers</h2>
      <ul>
        {offers.map((offer) => (
          <li key={offer.id}>{offer.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default OfferListComponent;
